import { GeolocateControl } from 'react-map-gl';

const GeoLocate = () => {
  return (
    <GeolocateControl
      positionOptions={{ enableHighAccuracy: true }}
      trackUserLocation={true}
    />
  );
};

export default GeoLocate;
